ProjectLifeCycleService.$inject = ['$http', '$q', 'spinnerService'];

function ProjectLifeCycleService($http, $q, spinnerService){
    var rtplcmilestoneservice = {
        rtPlcMilestoneAdd : rtPlcMilestoneAdd,
        getPhases : getPhases
    };
    return rtplcmilestoneservice;

    function rtPlcMilestoneAdd(reqData){
        var def = $q.defer();
        spinnerService.show();
		$http({
            url:"milestone/add",
            data: reqData,
            method:"POST"
        }).success(function(data) {
            def.resolve(data);
        })
        .error(function() {
            def.reject("Failed to get data");
        });
        return def.promise;
    }
   
    function getPhases(phase){
         var data = {
        "UAT":"data:image/png;base64,",
        
        "Design And Development":"data:image/png;base64,",
        
        "Integration and Testing":"data:image/png;base64,",
        
        "Warranty and Phase": " data:image/png;base64,",
        
        "P2S":"data:image/png;base64,"
    }
         return data[phase];
    }
}

module.exports = ProjectLifeCycleService;